var oldGrid, newGrid;

var copyGrid = function(grid) {
    var ret = [];
    for(var i = 0; i < 100; i++) {
        ret[i] = [];
        for(var j = 0; j < 100; j++) {
            ret[i][j] = grid[i][j];
        }
    }
    return ret;
}

var initGrid = function(part2){
    oldGrid = copyGrid(input);
    if(part2) {
        oldGrid[0][0] = 1;
        oldGrid[0][99] = 1;
        oldGrid[99][0] = 1;
        oldGrid[99][99] = 1;
    }
    newGrid = copyGrid(oldGrid);
}

var countNeighbors = function(i,j) {
    var sum = 0;
    for(var x = i-1; x <= i+1; x++){
        for(var y = j-1; y <= j+1; y++){
            //out of bounds neighbors count as off
            if(x < 0 || x > 99 || y < 0 || y > 99){ continue; }
            //skip myself
            if(x === i && y === j){ continue; }
            if(oldGrid[x][y]) { sum++; }
        }
    }
    return sum;
}

var totalLights = function(grid) {
    var total = 0;
    for(var i = 0; i < 100; i++) {
        for(var j = 0; j < 100; j++) {
            total += grid[i][j];
        }
    }
    return total;
}

var runSim = function(part2) {
    initGrid(part2);
    for(var s = 0; s < 100; s++) {
        //run for 100 steps
        for(var i = 0; i < 100; i++) {
            for(var j = 0; j < 100; j++) {
                if(part2 && (i === 0 || i === 99) && (j === 0 || j === 99)) {
                    newGrid[i][j] = 1;
                    continue;
                }
                var neighbors = countNeighbors(i,j);
                if(oldGrid[i][j] && neighbors !== 2 && neighbors !== 3) {
                    newGrid[i][j] = 0;
                }
                if(!oldGrid[i][j] && neighbors === 3) {
                    newGrid[i][j] = 1;
                }
            }
        }
        oldGrid = copyGrid(newGrid);
    }
}

runSim()
console.log('After 100 rounds, ' + totalLights(oldGrid) + ' lights are on!');
runSim(true);
console.log('With broken lights, ' + totalLights(oldGrid) + ' lights are on!');